import React from 'react';

class SignInCalculate extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <>
                <form className="col s12">
                    <div className="row">
                        <div className="input-field col s12">
                            <input
                                type="text"
                                name="review"
                                id="review"
                                autoComplete="off"
                                />
                            <label htmlFor="">review</label>
                        </div>
                    </div>
                </form>
            </>
        )
    }
}

export default SignInCalculate;
